import './App.css';
import {Bar} from 'react-chartjs-2';


function App() {
  return (
    <div className="App">

      <main className="main">

           <Bar
              data={{
                labels:['aa','bb'],
              }}
              height={400}
              width={600}
              options={{
                maintainAspectRatio:false,
              }}
           />

      </main>
    </div>
  );
}

export default App;
